  \"2015-09-26T21:13:10.776799\",\n\t\"name\": \"april-2008-scripps-institute-of-oceanography-sio-lidar-of-the-southern-california-coastline-lon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This lidar point data set collected during
  low tide conditions along an approximately 500-700 meter wide strip of the Southern
  California coastline within an area extending south from Long Beach to the US/Mexico
  border. Data were collected in Los Angeles, Orange and San Diego counties from south
  of the Downtown Long Beach Marina in Long Beach, California to Oceanside Harbor
  on April 13, 2008 between 17:17 and 19:52 UTC. Data were collected in San Diego
  County from San Onofre to south of the United States-Mexico border near Playas de
  Tijuana, Baja California, Mexico on April 12, 2008 between 16:04 and 19:13 UTC.
  Data set features include water, beach, cliffs, and top of cliffs. The all points
  data set contains the complete point cloud of first and last return elevation and
  laser intensity measurements recorded during the spring 2008 airborne lidar survey
  conducted semi-annually by the University of Texas at Austin for the Southern California
  Beach Processes Study. The data set was generated by the processing of laser range,
  scan angle, and aircraft attitude data collected using an Optech Inc. Airborne Laser
  Terrain Mapper (ALTM) 1225 system and geodetic quality Global Positioning System
  (GPS) airborne and ground-based receivers. Instrument settings and parameters during
  survey were: Nominal on-ground beam diameter: 25 cm Pulse rate: 25 kHz Maximum number
  of returns recorded: 2 Minimum separation between detected returns from a single
  pulse: 4.3 m Laser wavelength: 1064 nm Frequency of GPS sampling: 1 Hz Frequency
  of IMU sampling: 50 Hz; Scan angle: +/- 20 degrees Nominal height of instrument
  above ground: 1100 m Nominal single-swath pulse density: 2 m Nominal aggregate pulse
  density: 0.75 Nature of vertical control: Kinematic and static GPS points\",\n\t\"license_title\":
